    while count < n:
        i *= 10
        count += i * len(str(i))
    (div, mod) = divmod(n - (count - i * len(str(i))), len(str(i)))
    target = i // 9 - 1 + div
    if mod == 0:
        return int(str(target)[-1])
    else:
        return int(str(target + 0)[mod - 1])

